import React, { Component } from 'react';
import './App.css';

class App extends Component {
  constructor() {
    super();
    this.state = {
      monster: [
        {
          id: 'monster1',
          name: 'Frankenstein'
        },
        {
          id: 'monster2',
          name: 'Dracula'
        },
        {

          id: 'monster3',
          name: 'Zombie'
        },
      ]
    };
  }

  render() {
    return (
      <div className="App">
        {
          this.state.monster.map(monster => (
            <h1 key={monster.id}>{monster.name}</h1>
        ))}
      </div>
    )
  }
}

export default App;
